import { InView } from "react-intersection-observer";

const AnimatedSVG = () => {
  <InView>
    {({ inView, ref, entry }) => (
      <div ref={ref}>
        <h2>{`Header inside viewport ${inView}.`}</h2>
      </div>
    )}
  </InView>;
};
export default AnimatedSVG;
